import React from 'react';
import ReactDOM from 'react-dom';

export class PhotoshopContent extends React.Component {
    render () {
        return (
            <div className="photoshop-content">
                <h1>Restoration, Colorization, Manpulation</h1>
            </div>
        );
    }
};
